def count_gifts(n, arr):
    gifts = 0
    for i in range(n):
        if arr[i] == 4 or arr[i] == 5:
            gifts += 1
            if arr[i-1] == 4 or arr[i-1] == 5:
                gifts -= 1
            if arr[i-2] == 4 or arr[i-2] == 5:
                gifts -= 1
            if arr[i-3] == 4 or arr[i-3] == 5:
                gifts -= 1
    return gifts

